import React from "react";
import Products from "../components/Products";

function ProductPage() {
  return (
    <>
      <section className="flex flex-col w-full h-auto">
        <div className="flex h-[200px] w-full outline">
          <div className="h-[200px] w-full flex">
            <img src="/attachment/pic1.jpg" alt="" className="absolute flex" />
          </div>
          <span className="flex w-full h-full items-center justify-center font-bold text-3xl uppercase">
            OUR PRODUCT
          </span>
        </div>

        <div className="flex h-[200px] w-full outline">
          <span className="flex w-full h-full items-center justify-center font-bold text-3xl uppercase">
            OUR PRODUCT
          </span>
        </div>
      </section>
    </>
  );
}

export default ProductPage;
